const isProd = process.env.NODE_ENV !== 'development';

module.exports = {
  plugins: [
    require('postcss-preset-env'),
    isProd &&
      require('cssnano')({
        preset: 'default'
      })
  ].filter(Boolean)
};

import swc from 'rollup-plugin-swc';
import { nodeResolve } from '@rollup/plugin-node-resolve';
import { terser } from 'rollup-plugin-terser';
import pkg from './package.json';

const extensions = ['.js', '.ts', '.tsx'];
const external = _ => /node_modules/.test(_) && !/@swc\/helpers/.test(_);
const plugins = (targets, minify) =>
  [
    nodeResolve({
      extensions
    }),
    swc({
      jsc: {
        parser: {
          syntax: 'typescript'
        },
        externalHelpers: true
      },
      env: {
        targets
      },
      module: {
        type: 'es6'
      },
      sourceMaps: true
    }),
    minify && terser()
  ].filter(Boolean);

export default [
  {
    input: pkg.main,
    plugins: plugins('defaults, not ie 11, not ie_mob 11'),
    external,
    output: {
      file: pkg.publishConfig.main,
      format: 'cjs',
      exports: 'named',
      sourcemap: true
    }
  },
  {
    input: pkg.main,
    plugins: plugins('defaults, not ie 11, not ie_mob 11', true),
    external: () => false,
    output: {
      file: pkg.unpkg,
      format: 'umd',
      name: 'Chartist',
      exports: 'named',
      sourcemap: true
    }
  },
  {
    input: pkg.main,
    plugins: plugins('defaults and supports es6-module'),
    external,
    output: {
      file: pkg.publishConfig.module,
      format: 'es',
      sourcemap: true
    }
  }
];

{
  "compilerOptions": {
    /* Type Checking */
    "strict": true,
    "strictBindCallApply": true,
    "noFallthroughCasesInSwitch": true,
    "noImplicitOverride": true,
    "noImplicitReturns": true,
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    /* Modules */
    "baseUrl": ".",
    "module": "esnext",
    "moduleResolution": "node",
    "resolveJsonModule": true,
    "paths": {
      "chartist-dev": ["src"]
    },
    /* Emit */
    "declaration": true,
    "declarationMap": true,
    "inlineSourceMap": true,
    "outDir": "dist",
    /* Interop Constraints */
    "allowSyntheticDefaultImports": true,
    "isolatedModules": true,
    /* Language and Environment */
    "lib": [
      "dom",
      "esnext"
    ],
    "target": "esnext",
    /* Completeness */
    "skipLibCheck": true
  },
  "include": [
    "src"
  ]
}
